import React from 'react';
import { Link,} from 'react-router-dom';
import './Footer.css';

function Footer() {
    return(

        <div className="footersection">
            <div className="container">
                <div className="footerlogo">
                    <br /><br /><br />
                    <a href="/"><b>Beeonhive</b></a>
                </div>
            </div>
        </div>
    );
}


  
export default Footer;
